      subroutine imcdate
      implicit none
      include 'general.pa'
      include 'commonblock.f90'
!
!*s
!     NAME OF SUBROUTINE...IMCDATE
!
!     AUTHOR OF ROUTINE...E. H. CANFIELD 10/88
!
!     PURPOSE...
!
!   IMCDATE has the block data values of COMP0 (the cold Compton cross
!   sections) and ENXTAB (cross sections * fractional energy change).
!
!   It is called (once) by setup2d to get the data into memory.
!
!   These data, essentially those from the Stone-Nelson report.
!
!     GLOSSARY
!
!   comp0(i) = cold compton cross-section (cm**2).
!            = Klein-Nishina total sigma(xnu)
!        xnu = 5.*(i-1) kev.  i = 1, 201
!            = 0, 5, 10, ........ 995, 1000 kev.
!
!   enxtab(i,j) = hot compton cross-section * expected value of
!                   (xnu - xnuscat)/xnu  (cm**2*kev/kev)
!   (positive value means photon is depositing energy into electrons)
!     tea = 10.*(i-1) kev.  i = 1, 13
!         = 0, 10, 20, ........ 110, 120 kev.
!
!   xnu has equal log spacings.  j = 1, 66
!
!   xnu(j+1) - xnu(j) = 1.05 * (xnu(j) - xnu(j-1))
!
!   xnu(1) = 0.
!   xnu(2) = 2.314177408 kev.
!     ..
!     ..
!   xnu(52) = 511.0060 = emasskev
!     ..
!     ..
!   xnu(66) = 1057.1116
!
!
!
!
!        CHANGES:
!
!       M. Boettcher, 07/02/1997:
!
!    Additional table for non-thermal electrons: 
!       enx_nth(i, j, k, l) = "hot cross-section" * expected value of 
!                             (xnu - xnuscat)/xnu [cm^2 keV/keV]
!
!    Index i: Power-law index: p_ind = 1.6 + 0.2*(i-1)
!                                    = 1.6, ..., 6.6
!                                      (i = 1, ..., 26)
!
!    Index j: low-energy cut-off: gmin = 1.2^(j-1)
!                                      = 1, 1.2, ..., 2.48832
!                                        (j = 1, ..., 6)
!
!    Index k: high-energy cut-off: gmax = 100*2^(k-1)
!                                       = 100, 200, ..., 1.28e4
!                                        (k = 1, ..., 8)
!
!    Index l: Photon energy: xnu(0) = 0.
!                            xnu(1) = 2.314177408 keV
!
!                            xnu(l+1) = xnu(l) + 1.05*(xnu(l) - xnu(l-1))
!                                      (l = 1, ..., 66)
!
!                            xnu(66) = 1057.1116 keV
!
!
      integer i, j, k, l
!
